import React, { useEffect } from 'react'
import { Link, useNavigate } from "react-router-dom"
import { CSSTransition } from 'react-transition-group';
import Provider2 from './provider2.js';
import Provider from './provider.js';
import Provider3 from './provider3.js';
import { useDispatch, useSelector } from 'react-redux';
import { createProvider } from '../../store/provider.js';
import * as ProvidersActions from "../../store/provider.js"
import { ProviderInfoContext } from './ProviderInfoContext';




function ProviderQuestions() {
  const history = useNavigate()
  const dispatch = useDispatch()
  const [errors, setErrors] = React.useState(["Please fill out required fields"]);
  const [currentSection, setCurrentSection] = React.useState(1);
  const provider3 = useSelector(state => state.provider?.provider2)
  const Name = useSelector(state => state.provider?.provider2?.Name)
  const Address = useSelector(state => state.provider?.provider2?.address)
  const Phone = useSelector(state => state.provider?.provider2?.phone)
  const ZipCode = useSelector(state => state.provider?.provider2?.zipCode)
  const State = useSelector(state => state.provider?.provider2?.state)  
  const City = useSelector(state => state.provider?.provider2?.city)
  const { Approved,
    domesticViolence,
    LGBTQ,
    crisisResources,
    humanTrafficking,
    military,
    lawEnforcement,
    elderSurvivor,
    childSurvivor,
    confidential,
    nonConfidential,
    healthCenter,
    dvProgram,
    psychProgram,
    callpolice,
    advocacyProgram,
    legalAdvice,
    forensicExams,
    generalHealth,
    pregnancy,
    housing,
    collegeOnCampus,
    title9,
    tribal,
    coalition,
    std,
    hivSupport,
    immigrants,
    blindDeaf,
    disabled,
    directCareCo,
    directCareMed,
    directCareOther,
    substanceAbuse,
    missingPersons,
    specialNeeds,
    alternativeCare } = provider3
    let info = {Name, Address, Phone, ZipCode, City, State, Approved, domesticViolence, LGBTQ, crisisResources, humanTrafficking, military, lawEnforcement, elderSurvivor, childSurvivor, confidential, nonConfidential, healthCenter, dvProgram, psychProgram, callpolice, advocacyProgram, legalAdvice, forensicExams, generalHealth, pregnancy, housing, collegeOnCampus, title9, tribal, coalition  }
    const Trans = () => {
      setErrors([])
      // if (address !== '' && phone !== '' && name !== '' && zipCode !== '' && phone.length === 10 && zipCode.length === 5) {
        setCurrentSection(currentSection  + 1);
        console.log(currentSection)




      };
      console.log(provider3)
      const Results = () => {

  }
  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch(createProvider({ Approved,
      domesticViolence,
      LGBTQ,
      crisisResources,
      humanTrafficking,
      military,
      lawEnforcement,
      elderSurvivor,
      childSurvivor,
      confidential,
      nonConfidential,
      healthCenter,
      dvProgram,
      psychProgram,
      callpolice,
      advocacyProgram,
      legalAdvice,
      forensicExams,
      generalHealth,
      pregnancy,
      housing,
      collegeOnCampus,
      title9,
      tribal,
      coalition,
      std,
      hivSupport,
      immigrants,
      blindDeaf,
      disabled,
      directCareCo,
      directCareMed,
      directCareOther,
      substanceAbuse,
      missingPersons,
      specialNeeds,
      alternativeCare}))
    history('/provider/list')
  }
  useEffect(() => {
    setErrors([errors])
  }, [])

  React.useEffect(() => {
    if (errors.length > 0) {
      dispatch(ProvidersActions.getProvider())
    }
  }, [])
  return (
    <div >

      <div className="relative overflow-hidden h-full w-full">
        <CSSTransition
          in={currentSection === 1}
          timeout={100}
          classNames="slide"
          unmountOnExit
        >
          <Provider info={info} />
        </CSSTransition>

        <CSSTransition
          in={currentSection === 2}
          timeout={200}
          classNames="slide"
          unmountOnExit
        >
          <Provider2 info={info} />
        </CSSTransition>

        <CSSTransition
          in={currentSection === 3}
          timeout={100}
          classNames="slide"
          unmountOnExit
        >
          <Provider3 />
        </CSSTransition>
      </div>
      {currentSection === 3 ? (
        <div>
          <Link to="/provider/list">
            <button type="Submit" onClick={handleSubmit} className="font-serif  flex justify-center items-center w-60 mx-auto mt-12 px-4 py-2 bg-teal-400 border-2 text-2xl border-slate-400 text-slate-800  rounded-xl ">Results</button>
          </Link>
        </div>
      ) : (
        <div>
          <button onClick={Trans} className="font-serif  flex justify-center items-center w-60 mx-auto mt-12 px-4 py-2 bg-teal-400 border-2 text-2xl border-slate-400 text-slate-800  rounded-xl">Next</button>
        </div>
      )}

    </div>
  );
}


export default ProviderQuestions
